import React, { useState } from "react";

const Input = () => {
    const [input, setInput] = useState("");

    const textChange = (e) => {
        setInput(e.target.value);
    }

    return (
        <div>
            <input class="border border-gray-300 rounded-md p-4" type="text" value="" onChange={textChange}></input>
            <br />
            <p>{input}</p>
        </div>
    )
}

export default Input;
